def calculate_distance(city1, city2):
    """Calculate the Euclidean distance between two cities."""
    (x1, y1), (x2, y2) = coordinates[city1], coordinates[city2]
    return math.sqrt((x1 - x2) ** 2 + (y1 - y2) ** 2)

# Function to calculate the total round trip distance for given tour
def calculate_tour_cost(tour):
    cost = 0
    previous_city = 0
    for city in tour:
        cost += calculate_distance(previous_city, city)
        previous_city = city
    cost += calculate_distance(tour[-1], 0)  # Return to the depot
    return cost

